import Table from 'react-bootstrap/Table';


const DashboardDataTable = ({data = []}) => {

    return (
        <>
        <h2>Last 5 expenses</h2>
            <Table striped>
                <thead>
                    <tr >
                        <th>Name</th>
                        <th>Description</th>
                        <th>Amount</th>
                        <th>Time</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        data?.map((value, key) => {
                            return (
                                <tr key={key}>
                                    <td>{value.name}</td>
                                    <td>{value.discription}</td>
                                    <td>{value.amount}</td>
                                    <td>{value.time}</td>
                                </tr>
                            )
                        })
                    }
                </tbody>
            </Table>
        </>
    );
}

export default DashboardDataTable;
